    public int lengthOfLongestSubstring(String s) {
        if (s == null || s.length() == 0){
            return 0;
        }
        int result = 0;


        List<String > strList = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            String sub = s.substring(i,i +1);
            if (!strList.contains(sub)){
                strList.add(sub);

            }else {
                int index = strList.indexOf(sub);
                int len = strList.size();
                if (index == len -1){
                    strList.clear();
                }else {

//                    strList = strList.subList(index +1,len); //----->这个地方如果这样调用会StackOverflowError
                    strList = new ArrayList<>(strList.subList(index +1,len));
                }
                strList.add(sub);
            }
            if (strList.size() > result){
                result = strList.size();
            }
        }
        return result;
    }

